## A.2.1 INEFFICIENT ALGORITHMS

This category targets computational patterns such as recursion without memoization or arithmetic operations replaceable by bitwise alternatives. Such patterns are detected via function call tracking and control-flow analysis involving arithmetic operations and operand usage.

Figure 6 shows an example of directives generated by the symbolic advisor and the resulting optimized code. When given the raw recursive fib function, the detector matches it with the recursion rule from the Inefficient Algorithm category 1, which identifies recursion without memoization. Based on this match, it emits a directive template that recommends replacing recursion with memoization or dynamic programming. Guided by this directive, the downstream code-LLM produces the optimized version (B), where a dp buffer is introduced to eliminate redundant calls and improve runtime efficiency.

(A) Input Code
```cpp
int fib(int n){
    if (n <= 1) return n;
    return fib(n-1) + fib(n-2);
}
```

(B) Optimized Code
```cpp
int fib(int n){
    if (n <= 1) return n;
    if (dp[n] != -1) return dp[n];
    dp[n] = fib(n-1) + fib(n-2);
    return dp[n];
}
```

(C) Bottleneck Diagnosis for recursion without memoization
