## A.2.2 SUBOPTIMAL DATA STRUCTURE USAGE

This category addresses inefficient use of data structures, such as employing dynamic containers (e.g., std::vector) when their dynamic capabilities are not utilized, or using non-hash maps where hash-based structures would provide better performance. Such inefficiencies are detected through type analysis and usage pattern tracking, which identify opportunities to substitute simpler or more efficient data structures.

Figure 7 illustrates an example where a dynamic vector is unnecessarily used to store values of predetermined size. The symbolic advisor detects that the vector does not leverage any dynamic behavior (e.g., resizing, insertion at arbitrary positions) and matches it with the static replacement rule. Based on this detection, it generates a directive template recommending replacement with a fixed-size array. Guided by this directive, the downstream code-LLM produces the optimized version (B), where the vector is replaced by a static array, eliminating allocation overhead and improving runtime efficiency.

(A) Input Code
```cpp
int n;
scanf("%d", &n);
std::vector<int> v(n);
for (int i = 0; i < n; ++i) {
    // use v[i]
}
```

(B) Optimized Code
```cpp
int n;
scanf("%d", &n);
int v[n];
for (int i = 0; i < n; ++i) {
    // use v[i]
}
```

(C) Bottleneck Diagnosis for vector without dynamic behavior
The following vectors do not use dynamic operations: [variable: v, lines: 2â€“4]. Replacing them with a static array or fixed-size container can improve performance.

Figure 7: Static array directive example. Left: inefficient use of a dynamic vector. Right: optimized version using a static array. Bottom: directive emitted by the symbolic advisor.

## A.2.3 INEFFICIENT LIBRARY USAGE

This category addresses inefficient use of library functions, such as slow I/O operations (cin, cout) or expensive math functions (e.g., pow), which can often be replaced with faster alternatives. Such inefficiencies are detected by analyzing library call sites and inspecting the types and properties of their arguments.

Figure 8 presents an example where inefficient I/O operations are detected. The symbolic advisor identifies the use of cin and cout, which are known to incur higher overhead, and matches them with the I/O replacement rule. Based on this match, it generates a prompt recommending substitution with faster alternatives (scanf and printf). Guided by this prompt, the downstream code-LLM produces the optimized version (B), where the I/O calls are replaced, leading to improved runtime performance.

(A) Input Code
```cpp
int x, y;
cin >> x >> y;
int res = gcd(x, y);
cout << res << endl;
```

(B) Optimized Code
```cpp
int x, y;
scanf("%d %d", &x, &y);
int res = gcd(x, y);
printf("%d\n", res);
```

(C) Bottleneck Diagnosis for inefficient I/O library usage
The following I/O library calls rely on slow operations: [call: cin, lines: 2â€“2; call: cout, lines: 4â€“4]. Replacing them with faster alternatives (scanf, printf) can improve performance.

Figure 8: I/O replacement directive example. Left: inefficient use of cin/cout. Right: optimized version with scanf/printf. Bottom: directive emitted by the symbolic advisor.

## A.2.4 INEFFICIENT LOOP USAGE

This category targets costly operations that are repeatedly executed inside loops but can be safely moved outside, such as sorting or redundant calculations. Such inefficiencies are detected by analyzing loop bodies and extracting loop-invariant computations.

Figure 9 illustrates an example where redundant operations are placed inside a loop. The symbolic advisor detects that both the sorting operation and the minimum-value extraction are loop-invariant, and matches this case with the loop-invariant rule. Based on this match, it generates a performance-aware prompt recommending that these computations be hoisted outside the loop. Guided by this directive, the downstream code-LLM produces the optimized version (B), where sorting and minimum extraction occur once before the loop, eliminating redundant work and improving runtime efficiency.

(A) Input Code
```cpp
int res = 0;
for (int i = 0; i < n; i++) {
    std::sort(a, a + n);
    int min_v = a[0];
    // ...
}
```

(B) Optimized Code
```cpp
int res = 0;
std::sort(a, a + n);
int min_v = a[0];
for (int i = 0; i < n; i++) {
    // ...
}
```

(C) Bottleneck Diagnosis for redundant calls in loop
The following redundant calls are placed inside loops: [call: sort, lines: 3â€“4]. Moving these calls outside the loop, or caching their results, can eliminate redundant work and improve efficiency.

